import Layout from '../src/components/Layout';
import { Cookies } from 'react-cookie';

//components
import Nav from '../src/components/dashboard/Nav';
import Jumbo from "../src/components/dashboard/Jumbo";
import Footer from '../src/components/dashboard/Footer';

const cookies = new Cookies();

const home = () => {
    return (
        <Layout>
            <div className='main'>
                <Nav />
                <Jumbo />
                <div className='cards'>
                    <div className='card'>

                    </div>
                    <div className='card'>

                    </div>
                    <div className='card'>

                    </div>
                    <div className='card'>

                    </div>
                </div>
                <Footer />
            </div>
            <style global jsx>{`
                html,
                body,
                body > div:first-child,
                div#__next,
                div#__next > div,
                div#__next > div > div {
                    height: 100%;
                }

                *{
                    box-sizing: border-box;
                }

                .main{
                    width: 100%;
                    height: 100%;
                    background: linear-gradient(180deg, #C2C0C0, white);
                }   

                .cards{
                    width: 100%;
                    height: 30%;
                    border: 1px solid;
                    justify-content: center;
                    align-items: center;
                    display: flex;
                    flex-wrap: wrap;
                }      

                .cards .card{
                    width: 23%;
                    height: 90%;
                    border: 1px solid;
                    margin: 10px;
                }

                @media (max-width: 1400px){
                    .cards{
                        height: 50%;
                        margin-bottom: 200px;
                    }

                    .cards .card{
                        width: 23%;
                        height: 63%;
                    }
                }

                @media (max-width: 1280px){
                    .cards{
                        height: 50%;
                        margin-bottom: 200px;
                    }

                    .cards .card{
                        width: 30%;
                        height: 43%;
                    }
                }

                @media (max-width: 1024px){
                    .cards{
                        height: 60%;
                        margin-bottom: 200px;
                    }

                    .cards .card{
                        width: 45%;
                        height: 43%;
                    }
                }

                @media (max-width: 600px){
                    .cards{
                        height: 100%;
                        margin-bottom: 200px;
                    }

                    .cards .card{
                        width: 80%;
                        height: 23%;
                    }
                }

                @media (max-width: 400px){
                    .cards{
                        height: 150%;
                        margin-bottom: 300px;
                    }

                    .cards .card{
                        width: 95%;
                        height: 23%;
                    }
                }
            `}</style>
        </Layout>
    );
}

export default home;
